  | 4 -> TOKEN_MINUS 
  | 5 -> TOKEN_STAR 
  | 6 -> TOKEN_SLASH 
  | 7 -> TOKEN_NUMBER 
  | 10 -> TOKEN_end_of_input
  | 8 -> TOKEN_error
  | _ -> failwith "tokenTagToTokenId: bad token"

